import React ,{Component} from 'react';
import axios from 'axios';
class blog extends Component{
    state={
        users:[]
    }
    
    componentDidMount(){
        axios.get("https://jsonplaceholder.typicode.com/users")
    .then(res=>{
        console.log(res)
        this.setState({
            users:res.data
        })
    })
    }
    render(){
        return(
<div>
<h2>This is a blog</h2>
<p>Please choose your blog !</p>
</div>


        );
    }
}
export default blog;
